defs.script:
 //
var myCoilLogFunction = function () {
    let attribute = this.getAttribute("index");
    console.log(attribute);
    viewCoilLogHandler.postMessage(attribute);
};
var myButtonFunction = function () {
    let attribute = this.getAttribute("index");
    console.log(attribute);
    if (typeof sensorHandler === "undefined") handleCoilDevice(attribute);
    else buttonHandler.postMessage(attribute);
};
var mySensorFunction = function () {
    let attribute = this.getAttribute("index");
    console.log(attribute);
    sensorHandler.postMessage(attribute);
};
var myEdittingFunction = function () {
    let attribute = this.getAttribute("index");
    edittingHandler.postMessage(attribute);
};

function reRenderHMI(RS485DataStr) {
    RS485DataStr.RS485Data.forEach((element) => {
        if (element.MemoryType === 0 || element.MemoryType === 4) {
            // FILL COIL STATE TO SVG
            let idElementON = "ON-" + `${element.SlaveId}` + "-" + `${element.Address}` + "-" + `${element.FC}`+ (typeof element.GetBit !== "undefined" ? `-${element.GetBit}` : "")+ (typeof element.Location !== "undefined" ? `-${element.Location}` : "");
            let idElementOFF = "OFF-" + `${element.SlaveId}` + "-" + `${element.Address}` + "-" + `${element.FC}` + (typeof element.GetBit !== "undefined" ? `-${element.GetBit}` : "")+ (typeof element.Location !== "undefined" ? `-${element.Location}` : "");
            let strHiddenOrVisibleOFF = element.CoilValue ? "hidden" : "visible";
            let strHiddenOrVisibleON = element.CoilValue ? "visible" : "hidden";
            Array.prototype.forEach.call(document.getElementsByClassName(`${idElementON}`), function (item) {
                if (item.className.animVal === idElementON) {
                    item.style.visibility = `${strHiddenOrVisibleON}`;
                    console.log(item.className.animVal);
                } else if (typeof item.className.animVal === "undefined") {
                    item.style.visibility = `${strHiddenOrVisibleON}`;
                    console.log(item.className);
                }
            });
            Array.prototype.forEach.call(document.getElementsByClassName(`${idElementOFF}`), function (item) {
                if (item.className.animVal === idElementOFF) {
                    item.style.visibility = `${strHiddenOrVisibleOFF}`;
                    console.log(item.className.animVal);
                } else if (typeof item.className.animVal === "undefined") {
                    item.style.visibility = `${strHiddenOrVisibleOFF}`;
                    console.log(item.className);
                }

                console.log(item.className.animVal);
            });
            if (element.MemoryType === 0) {
                let idAudio = "AUDIO-" + `${element.SlaveId}` + "-" + `${element.Address}`;
                Array.prototype.forEach.call(document.getElementsByClassName(`${idAudio}`), function (item) {
                    if (element.CoilValue) {
                        console.log("play");
                        if (item.tagName == "AUDIO") item.play();
                    } else {
                        console.log("stop");
                        if (item.tagName == "AUDIO") {
                            item.pause();
                            item.currentTime = 0;
                        }
                    }
                });
            }
            // FILL TO CONTROL COIL
            let idElementCOIL = "COIL-" + `${element.SlaveId}` + "-" + `${element.Address}`  + "-" + `${element.FC}`+ (typeof element.GetBit !== "undefined" ? `-${element.GetBit}` : "")+ (typeof element.Location !== "undefined" ? `-${element.Location}` : "");
            Array.prototype.forEach.call(document.getElementsByClassName(`${idElementCOIL}`), function (item) {
                if (item.className.animVal === idElementCOIL) {
                    item.setAttribute("index", element.Index);
                    item.addEventListener("click", myButtonFunction, false);
                    item.style.cursor = "pointer";
                } else if (typeof item.className.animVal === "undefined") {
                    item.setAttribute("index", element.Index);
                    item.addEventListener("click", myButtonFunction, false);
                    item.style.cursor = "pointer";
                }
                console.log(item.className.animVal);
            });

            // FILL TO COIL LOG
            let idElementCOILLOG = "COILLOG-" + `${element.SlaveId}` + "-" + `${element.Address}` + (typeof element.GetBit !== "undefined" ? `-${element.GetBit}` : "");
            Array.prototype.forEach.call(document.getElementsByClassName(`${idElementCOILLOG}`), function (item) {
                if (item.className.animVal === idElementCOILLOG) {
                    item.setAttribute("index", element.Index);
                    item.addEventListener("click", myCoilLogFunction, false);
                    item.style.cursor = "pointer";
                } else if (typeof item.className.animVal === "undefined") {
                    item.setAttribute("index", element.Index);
                    item.addEventListener("click", myCoilLogFunction, false);
                    item.style.cursor = "pointer";
                }
                console.log(item.className.animVal);
            });
        } else if (element.MemoryType == 1 || (element.MemoryType === 6 && !element.GroupName.includes("Delta"))) {
            //FILL VALUE TO TEXT
            let idTXT = "TXT-" + `${element.SlaveId}` + "-" + `${element.Address}`;
            let valueTXT = element.Value.toFixed(1);
            Array.prototype.forEach.call(document.getElementsByClassName(`${idTXT}`), function (item) {
                item.textContent = `${valueTXT}${typeof element.Unit !== "undefined" ? element.Unit : ""}`;
                item.setAttribute("index", element.Index);
                item.addEventListener("click", mySensorFunction, false);
            });

            // FILL TO EDITTING VALUE
            let idElementEDITTING = "EDITTING-" + `${element.SlaveId}` + "-" + `${element.Address}` + (typeof element.GetBit !== "undefined" ? `-${element.GetBit}` : "");
            Array.prototype.forEach.call(document.getElementsByClassName(`${idElementEDITTING}`), function (item) {
                if (item.className.animVal === idElementEDITTING) {
                    item.setAttribute("index", element.Index);
                    item.addEventListener("click", myEdittingFunction, false);
                    item.style.cursor = "text";
                } else if (typeof item.className.animVal === "undefined") {
                    item.setAttribute("index", element.Index);
                    item.addEventListener("click", myEdittingFunction, false);
                    item.style.cursor = "text";
                }
                console.log(item.className.animVal);
            });
        }
        //
    });
    // example class name: MULTI ON-2-47 && ON-2-48
    // SET STATE FOR COIL THAT HAS MULTI CONDITIONS
    Array.prototype.forEach.call(document.getElementsByClassName("MULTI"), function (itemClass) {
        let fullClassesName = itemClass.className.animVal;
        let valuesWithConditions = fullClassesName.replaceAll("MULTI ", "");
        let arrayValues = [];
        // SPLIT VALUE NAME FROM STRING
        valuesWithConditions.split(" ").forEach((item) => {
            if (item.includes("ON")) {
                let splitClassON = item.split("-");
                console.log(splitClassON.toString());
                let conditionValue = false;
                if (typeof splitClassON[3] === "undefined") {
                    console.log(RS485DataStr.RS485Data.find((rs485) => rs485.SlaveId == splitClassON[1] && rs485.Address == splitClassON[2]));
                    conditionValue = RS485DataStr.RS485Data.find((rs485) => rs485.SlaveId == splitClassON[1] && rs485.Address == splitClassON[2]).CoilValue;
                } else  {
                    console.log(RS485DataStr.RS485Data.find((rs485) => rs485.SlaveId == splitClassON[1] && rs485.Address == splitClassON[2] 
                    && (typeof splitClassON[3] !== "undefined" && (rs485.GetBit == splitClassON[3] || splitClassON[3] === ''))
                    && (typeof splitClassON[4] !== "undefined" && (rs485.FC == splitClassON[4] || splitClassON[4] === ''))
                    && (typeof splitClassON[5] !== "undefined" && (rs485.Location == splitClassON[5] || splitClassON[5] === ''))
                    ));
                    conditionValue = RS485DataStr.RS485Data.find((rs485) => rs485.SlaveId == splitClassON[1] && rs485.Address == splitClassON[2]  
                    && (typeof splitClassON[3] !== "undefined" && (rs485.GetBit == splitClassON[3] || splitClassON[3] === ''))
                    && (typeof splitClassON[4] !== "undefined" && (rs485.FC == splitClassON[4] || splitClassON[4] === ''))
                    && (typeof splitClassON[5] !== "undefined" && (rs485.Location == splitClassON[5] || splitClassON[5] === ''))
                    ).CoilValue;
                }

                console.log(item + conditionValue);
                arrayValues.push(conditionValue);
            } else if (item.includes("OFF")) {
                let splitClassON = item.split("-");
                let conditionValue = false;
                if (typeof splitClassON[3] === "undefined") {
                    console.log(RS485DataStr.RS485Data.find((rs485) => rs485.SlaveId == splitClassON[1] && rs485.Address == splitClassON[2]));
                    conditionValue = !RS485DataStr.RS485Data.find((rs485) => rs485.SlaveId == splitClassON[1] && rs485.Address == splitClassON[2]).CoilValue;
                } else {
                    console.log(RS485DataStr.RS485Data.find((rs485) => rs485.SlaveId == splitClassON[1] && rs485.Address == splitClassON[2]  
                    && (typeof splitClassON[3] !== "undefined" && (rs485.GetBit == splitClassON[3] || splitClassON[3] === ''))
                    && (typeof splitClassON[4] !== "undefined" && (rs485.FC == splitClassON[4] || splitClassON[4] === ''))
                    && (typeof splitClassON[5] !== "undefined" && (rs485.Location == splitClassON[5] || splitClassON[5] === ''))
                    ));
                    conditionValue = !RS485DataStr.RS485Data.find((rs485) => rs485.SlaveId == splitClassON[1] && rs485.Address == splitClassON[2]  
                    && (typeof splitClassON[3] !== "undefined" && (rs485.GetBit == splitClassON[3] || splitClassON[3] === ''))
                    && (typeof splitClassON[4] !== "undefined" && (rs485.FC == splitClassON[4] || splitClassON[4] === ''))
                    && (typeof splitClassON[5] !== "undefined" && (rs485.Location == splitClassON[5] || splitClassON[5] === ''))
                    ).CoilValue;
                }
                console.log(item + conditionValue);
                arrayValues.push(conditionValue);
            } else if (item.includes("TXT")) {
                let splitClassON = item.split("-");
                let conditionValue = RS485DataStr.RS485Data.find((rs485) => rs485.SlaveId == splitClassON[1] && rs485.Address == splitClassON[2]).Value;
                console.log(item + conditionValue);
                arrayValues.push(conditionValue);
            } else {
                arrayValues.push(item);
            }
        });
        // FULL CONDITION
        let conditionsStr = arrayValues.toString().split(",").join(" ");
        console.log("Condition String: ", conditionsStr);
        let IsTrue;
        if (eval(conditionsStr)) {
            IsTrue = true;
            console.log("Final result: ", true);
            //Answer
        } else {
            IsTrue = false;
            console.log("Final result: ", false);
        }
        let strHiddenOrVisibleON = IsTrue ? "visible" : "hidden";
        console.log("strHiddenOrVisibleON String: ", strHiddenOrVisibleON, fullClassesName);
        Array.prototype.forEach.call(document.getElementsByClassName(`${fullClassesName}`), function (item) {
            if (item.className.animVal === fullClassesName) item.style.visibility = `${strHiddenOrVisibleON}`;
            else if (typeof item.className.animVal === "undefined") item.style.visibility = `${strHiddenOrVisibleON}`;
        });
    });
    return RS485DataStr.WifiInfo;
}
